import React from "react";
import { Header } from "../components/Layout";

const Fallback = () => {
    return (
        <>
            <Header />
            <h1 className="my-10 text-3xl font-bold">
                {"Page not found :("}
            </h1>
        </>
    );
}

export default Fallback;
